import React from 'react';
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  CartesianGrid,
  ResponsiveContainer
} from 'recharts';

function PredictionChart({ data }) {
  return (
    <div className="mt-8 bg-gray-900 p-6 rounded-xl shadow-lg">
      <h2 className="text-xl font-semibold mb-4 text-white">Emission Predictions (2025â€“2050)</h2>
      <ResponsiveContainer width="100%" height={400}>
        <LineChart data={data}>
          <XAxis dataKey="year" stroke="#ffffff" />
          <YAxis stroke="#ffffff" />
          <Tooltip
            contentStyle={{ backgroundColor: '#1f2937', border: 'none', color: '#fff' }}
            labelStyle={{ color: '#a0aec0' }}
            itemStyle={{ color: '#fff' }}
          />
          <CartesianGrid stroke="#4b5563" strokeDasharray="3 3" />
          <Line
            type="monotone"
            dataKey="predicted_co2"
            stroke="#10b981"
            strokeWidth={3}
            dot={{ r: 4, fill: '#10b981' }}
            activeDot={{ r: 6 }}
          />
        </LineChart>
      </ResponsiveContainer>
    </div>
  );
}

export default PredictionChart;
